import React from 'react';
import { useNavigate } from 'react-router-dom';

export function logout() {
  const navigate = useNavigate();

  // ACCESS_TOKEN 제거
  localStorage.removeItem("ACCESS_TOKEN");

  // /login 페이지로 이동
  navigate('/login');
}
